import React from 'react';

const App = () => {
  return (
    <div>
      <section id="section1">
        <header>Welcome</header>
        <p>Hello world for now!</p>
        <button>Login</button>
        <button>Sign Up</button>
      </section>
    </div>
  );
};

export default App;
